import React from "react";

const Review = (props) => {
  const { score, title, description } = props.attributes;
  return (
    <div className="reviewCard">
      <div className="rating-container">
        <div className="rating-score">{score}</div>
      </div>
      <div>{title}</div>
      <div>{description}</div>
    </div>
  );
};

export default Review;
